// MapView.js
import React from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet'; // or your preferred mapping library
import 'leaflet/dist/leaflet.css';

function MapView({ trafficData }) {
    return (
        <MapContainer center={[0, 0]} zoom={2} style={{ height: '500px', width: '100%' }}>
            <TileLayer
                url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
            />
            {trafficData.map((data, index) => (
                <Marker key={index} position={[data.latitude, data.longitude]}>
                    <Popup>
                        <div>
                            <strong>Location:</strong> {data.location} <br />
                            <strong>Vehicle Count:</strong> {data.vehicleCount} <br />
                            <strong>Average Speed:</strong> {data.avg_speed} <br />
                            <strong>Congestion Level:</strong> {data.congestionLevel} <br />
                            <strong>Weather Condition:</strong> {data.weather_condition} <br />
                            <strong>Incident:</strong> {data.incident}
                        </div>
                    </Popup>
                </Marker>
            ))}
        </MapContainer>
    );
}

export default MapView;
